description:
Talk Talk - Life's What You Make It [promo].VOB  



Very HQ promo music video. &quot;Life's What You Make It&quot; is a song by the English band Talk Talk. The song was released in 1985 and appears on the album The Colour of Spring; it became a big hit in the UK, peaking at #16, and internationally, reaching the Top 20 in several countries. The track also appeared in the game Grand Theft Auto: Vice City, where it plays on the pop radio station, Flash FM.
(video does not have any logos) 


